import React from 'react';

class FeedForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = { numberOfPeople: '', billAmount: '' };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ numberOfPeople: event.target.numberOfPeople, billAmount: event.target.billAmount });
    }

    handleSubmit(event) {
        let method = this.props.method;
        let mode = this.props.mode;
        event.preventDefault();
        async function postData(url = '', data = {}) {
            let request = {
                method: method,
                mode: mode,
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            };
            const response = await fetch(url, request);
            return await response.json();
        }
        postData('https://example.com/answer', { numberOfPeople: event.target.numberOfPeople, billAmount: event.target.billAmount })
            .then((response) => {
                console.log(response);
            });
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <label>
                    Number of people:
                    <input type="number" value={this.state.value} onChange={this.handleChange} />
                </label>
                <br />
                <label>
                    Bill amount:
                    <input type="number" value={this.state.value} onChange={this.handleChange} />
                </label>
                <br />
                <input type="submit" value="Submit" />
            </form>
        );
    }
}
export default FeedForm;
